DROP TABLE IF EXISTS `goods`;
CREATE TABLE `goods` (
  `id` int(11) NOT NULL,
  `title` varchar(100) NOT NULL,
  `img` varchar(255) NOT NULL,
  `price` double(8,2) NOT NULL,
  `oldprice` double(8,2) DEFAULT NULL,
  `goodsUrl` varchar(255) DEFAULT NULL,
  `addtime` bigint(11) NOT NULL,
  `endtime` bigint(11) DEFAULT '0',
  `sorceid` int(4) NOT NULL DEFAULT '0',
  `sold` int(6) NOT NULL DEFAULT '0' COMMENT '已经出售的数量',
  `desc` varchar(255) DEFAULT NULL COMMENT '描述',
  `click` bigint(22) DEFAULT '0',
  `isy` int(1) DEFAULT '1' COMMENT '是否包邮',
  `itemType` int(11) NOT NULL,
  `other` varchar(255) DEFAULT NULL,
  `state` tinyint(1) NOT NULL DEFAULT '1' COMMENT '商品状态',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

